message:
Poder Constituinte Originário: o Povo.

Características: 
1. Ele é Inicial: não existe nenhum outro antes ou acima dele;
2. Incondicionado: não está submetido a nenhuma regra de forma ou de conteúdo;
3. Permanente: continua existindo mesmo após concluir a sua obra;
4. Inalienável: sua titularidade não é possível de transferência (a nação nunca perde o direito de mudar sua vontade).


Ele é permanente, já que o poder constituinte originário não se esgota com a edição da nova Constituição, sobrevivendo a ela e fora dela como forma e expressão da liberdade humana, em verdadeira ideia de subsistência. É permanente, pois não desaparece com a realização de sua obra, ou seja, com a elaboração de uma nova Constituição. Como afirmado por Sieyès, o Poder Constituinte não esgota sua titularidade, que permanece latente, manifestando-se novamente mediante uma nova Assembleia Nacional Constituinte ou um ato revolucionário (povo na porta dos quartéis ordenando as FA).

Uma das formas de se exercer o poder constituinte: 

Este seria o melhor exemplo de exercício direto do poder constituinte, na medida em que, na revolução vitoriosa, necessariamente há a ruptura do regime anterior e “o nascimento de uma nova Constituição material, a que se segue, a curto, a médio ou em longo prazo, a adequada formalização”. Assim, o povo, titular do poder, impondo a sua vontade, determina uma nova e legítima ordem constitucional material, que, posteriormente, é formalizada.

Estas são as bases do direito Constitucional.  Todo ministro do STF sabe disso.

Presidente Bolsonaro de forma muito pedagógica criticou o “eu autorizo” porque ele representa a atitude covarde de quem quer se colocar sob a tutela dos outros e não se responsabilizar por sua própria história. O ensinamento do presidente encontra confluência com o de Gandhi que fala: “seja a mudança que você quer para o mundo”; ou com o princípio da autonomia de Kant que pede para agirmos de tal forma que cada ação nossa, mesmo que fundamentada num princípio interno, possa se verter em lei universal. Ou ainda no ensinamento de Cristo para se fazer sempre aquilo que esperamos que os outros façam. O presidente está querendo ensinar ao povo o poder que possui, que é muito maior do que se entregar à tutela dele ou das Forças Armadas. As Forças Armadas, o povo e o território são as únicas condições realmente necessárias para um Estado Soberano: teremos que aprender a lidar com isso para construirmos outra história. As Forças Armadas seguirão o chamado do povo. Por isso ele finalizou o discurso evocando um ensinamento de Reagan de que temos de nos perguntar o que podemos fazer pelo nosso país, e não o que nosso país pode fazer por nós. Nosso presidente quer nos chamar à vida adulta de uma nação, pois somente adultos são capazes de agir de forma autônoma e responsável. O silêncio dele também deve significar um chamado à reflexão. O homem adulto não pode sempre esperar de seu pai o conselho sobre o que fazer: tem de encontrar a resposta por si mesmo.

Rochelle Cysne
